import { Switch, Route } from 'react-router-dom;'

import { Header } from './components/Header';
import { Main } from './components/Main';
import './App.css';
import { NotFound } from './pages/NotFound';

function App() {

  return (
    <>
      <Header />
      <Main>
       <Switch>
        <Route>
          <HomePage path='/' />
        </Route>
        <Route>
          <Details path='/country/:name' />
        </Route>
        <Route>
          <NotFound/>
        </Route>
       </Switch>
      </Main>
    </>
  );
}

export default App;
